import React from "react";
import Project from './Project.js';
import {readRemoteFile} from 'react-papaparse';

class Projects extends React.Component {
  render() {
    let projectsSelvIkei = ['a','a','a','a'];

    function splitter(results) {
      let dadosLength = results.length;
      let selvCounter = 0;
      for (let i = 1; i < dadosLength; i++) {
        if(results[i][0] == 'selv ikei '){
          projectsSelvIkei[selvCounter] = results[i][1];
          selvCounter++;
        }
      }
      };
      const items = [];
      readRemoteFile("http://localhost:3001/projectos.csv", {
            complete: (results) => {
              splitter(results['data']);
              for (let i = 0; i < 4; i++) {
                  items.push(<li>{projectsSelvIkei[i]}</li>);
              }
            },
          });




      return(
        <div id="projects">

        {items}

        </div>
      )
  }
}


export default Projects
